import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    const initialShot = path.join(screenshotsDir, 'step_1_initial.png');
    await page.screenshot({ path: initialShot });
    screenshots.push(initialShot);

    // Wait for the cart element (div with class 'cart' and text 'Cart')
    await page.waitForSelector("div.cart", { timeout: 5000 });

    // Click the cart using text selector to ensure uniqueness
    const cartDiv = await page.waitForSelector("xpath=//div[contains(@class,'cart') and contains(normalize-space(),'Cart')]", { timeout: 5000 });
    await cartDiv.click();

    // Wait for the cart modal to appear (div#cartModal)
    await page.waitForSelector("#cartModal", { timeout: 5000 });

    // Wait for the modal to be visible (display: block)
    await page.waitForFunction(() => {
      const modal = document.getElementById('cartModal');
      return modal && window.getComputedStyle(modal).display !== 'none' && modal.offsetParent !== null;
    }, { timeout: 5000 });

    // Take screenshot of the open cart modal
    const modalShot = path.join(screenshotsDir, 'step_2_cart_modal_open.png');
    await page.screenshot({ path: modalShot });
    screenshots.push(modalShot);

    // Extract cart modal heading and cart items count for verification
    const modalTitle = await page.$eval('#cartModal .cart-content h2', el => el.textContent.trim());
    let cartItemsCount = 0;
    try {
      cartItemsCount = await page.$$eval('#cartItems .cart-item', els => els.length);
    } catch {
      // If cart is empty, .cart-item may not exist
      cartItemsCount = 0;
    }

    return {
      success: true,
      action: "Opened the shopping cart modal and verified its appearance",
      extractedData: {
        modalTitle,
        cartItemsCount
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
